import React from "react";
import {ListGroup, ListGroupItem} from "reactstrap";

const Show = props => {

    return (
        <div>
            <ListGroup>
                {
                    props.data ?
                        props.data.map(
                            item => {

                                return (
                                    <ListGroupItem
                                        key={item.id}
                                        tag="a"
                                        action
                                    >
                                        {
                                            item.name
                                        }
                                    </ListGroupItem>
                                )
                            }
                        )
                        :
                        <Alert color="warning">
                            Empty
                        </Alert>
                }
            </ListGroup>
        </div>
    )
}

export default Show
